import React from 'react';

function Avatar({children,backgroundColor,
    padding,
    color,
    borderRadius,
    fontsize,
    textAlign}){
    const style={
        backgroundColor,
        padding,
        color,
        borderRadius,
        fontsize,
        textAlign

    }
    return <div style={style}>
        {children}
    </div>;
}

export default Avatar;
